const htmlTemplate='\n  <div class="col-lg-4 col-md-6 col-12">\n    <div class="article-panel bg-custom">\n      <a href="/partners/detail?partner={slug}">\n        <div class="article-img">\n          <img src="{logo}" alt="" class="img-fluid">\n        </div>\n        <div class="article-wrapper">\n          <div class="article-content">\n            <div>\n              <h4 class="heading mb-0 name">{name}</h4>\n            </div>\n            <div class="listingDate">\n              <p>{listingDate}</p>\n            </div>\n            <div class="teamMembers">\n              <p>Team Members: {teamMembers}</p>\n            </div>\n          </div>\n        </div>\n      </a>\n    </div>\n  </div>\n';let load_more_status=!1;const getPartnerData=async()=>{try{const responseData=(await axios.get("https://marketdata.safemoon.com/api/partner/list-home?sort=createdAt&sortType=DESC")).data,partners=Object.keys(responseData).reduce(((acc,key)=>(key.startsWith("partners")&&(acc=[...acc,...responseData[key]]),acc)),[]);if(Array.isArray(partners)){const allPartnersHtml=(load_more_status?partners:partners.slice(0,9)).map((partner=>{const{slug:slug,logo:logo,name:name,listingDate:listingDate,teamMembers:teamMembers}=partner;let partnerHtml=htmlTemplate;return partnerHtml=partnerHtml.replace(/{slug}/g,slug),partnerHtml=partnerHtml.replace(/{logo}/g,logo),partnerHtml=partnerHtml.replace(/{name}/g,name),partnerHtml=partnerHtml.replace(/{listingDate}/g,listingDate.split(" ")[0]),partnerHtml=teamMembers?partnerHtml.replace(/{teamMembers}/g,teamMembers):partnerHtml.replace(/<div class="teamMembers">[\s\S]*?<\/div>/g,""),partnerHtml}));document.querySelector("#partners-list .container .row").innerHTML=allPartnersHtml.join("")}else console.error("Invalid partner data format.")}catch(error){console.error("Error retrieving partner data:",error)}};setTimeout(getPartnerData,100),$(".load_more_btn").click((function(){$(".load_more_btn").hide(),load_more_status=!0,getPartnerData()}));
